  render() {
    return (
      <div className="flex space-x-10 justify-center">
        <button className="bg-blue-200 px-3" activeClassName="bg-blue-500 px-3"><Link to="/" >New Proposal</Link></button>
        <button className="bg-blue-200 px-3" activeClassName="bg-blue-500 px-3"><Link to="/about">All Proposals</Link></button>
        <button className="bg-blue-200 px-3" activeClassName="bg-blue-500 px-3"><Link to="/edit">Edit Proposal</Link></button>
      </div>
    );
  }
  }

